usage/component.html.body:
Component
Is a decorator that converts your class into Vue instance constructor.
@Component({ 
  template: '{{ message }}'
  /* ... other vue component options ... */
})
class Foo {
  message: string = 'hello'
}

is equivalent to
var Foo = Vue.extend({
    template: '{{ message }}',
    data: {
      message: 'hello'
    } 
    /* ... other vue component options ... */ 
  })


Note: This decorator is to create a Vue instance constructor. To use it, you have to manually register it as a Vue component or use new keyword to make it as Vue instance.

Global Registration
Vue.component('my-foo', Foo);

new Vue({
  el: '#app'
})

Local Registration
new Vue({
  el: '#app',
  components: {
    'my-foo': Foo
  }
})

As Main Vue Instance
new Foo().$mount('#your-main-element-id')

usage/methods-and-computed-properties.ht.body:
Methods and Computed Properties
All methods in Component class will become part of methods attributes except for the internal hook methods used by Vue (eg: created, beforeDestroy, destroyed, etc...).  You can also define getter and setter that will become part of computed attribute.
@Component({
  template: 
  `

        now: {{val}}, 
        next: {{next}}

    Inc
  `
})
class Foo {

  // data
  val: number = 1

  // part of internal hooks
  created() {
    console.log('Foo created')
  }

  // method
  inc() {
    this.val += 1;
  }

  // property - get
  get next() : number {
    return this.val + 1;
  }

}

Code above is equivalent to:
Vue.extend({
  template: 
  `

        now: {{val}}, 
        next: {{next}}

    Inc
  `

  created: function () {
    console.log('Foo created')
  },

  data: function () {
    return { val: 1 }
  },

  methods: {
    inc: function () {
      this.val += 1;
    }
  },

  computed: {
    next: {
      get: function() {
        return this.val + 1;
      }
    }
  }
})

usage/props.html.body:
Prop
You can use Prop decorator to have props in your class. 
@Component()
class MyComp {

  // simple prop
  @Prop()
  message: string

  // prop with options (you can put all official Vue props options here)
  @Prop({
    default: 'meh',
    type: String
  })
  message2: any

  // prop with default value assigned from constructor
  @Prop()
  message3: string

  // prop with default value assigned inline
  @Prop()
  message4: string = 'yeah'

  // prop with options and default value assigned inline
  @Prop({                
    type: String
  })
  message5: any = 'foo'

  // prop with default value assigned both inline/constructor and in options
  // you should avoid this way - however default value assigned in options will be use.
  // if you do this, then you'll see warning in the console.  
  @Prop({                
    type: String,
    default: "I'm win"
  })
  message6: any = 'kick'

  constructor() {
    this.message3 = 'what'
  }

}

usage/watch.html.body:
Watch
Vue allows you to observe the data changes through $watch. To do it in VueTyped you just simply need to add function in your class decorated with Watch decorator like this:
import { Component, Watch } from 'vue-typed'

@Component({
  template: `

    Total clicks: {{info.msg.length}}
    Counter: {{counter}}
    Add

      {{i}}


    `
})
export class App {  
  counter:number = 1;

  info = {
    clicks: 0,
    msg: []
  }

  addCounter() {
    console.log('click')
    this.counter += 1;
  }

  @Watch('counter')
  onCounterChange(newValue:number, oldValue:number) {
    this.info.msg.push( oldValue + ' -> ' + newValue );
  }

  // deep watch
  @Watch('info', true)
  onInfoChange(newValue, oldValue) {
    console.log('info changed: ', newValue, oldValue);
  }
}

