Use Component With VueRouter
Since the class decorated with Component is equivalent to Vue.extend({}) so you can just simply use it as routes component.
@Component({ template: 'This is foo!' }) 
class Foo { }

@Component({ template: 'This is bar!' }) 
class Bar { }

var routes = [
  { path: '/foo', Foo },
  { path: '/bar', Bar },
]

