advanced/class-inheritance.html.body:
Class Inheritance
Inheritance in Vue is done by calling Vue.extend() method : 
var Parent = Vue.extend({
  data: function() {
    return {
      foo: 'This is foo!'
    }
  }
})

var Child = Parent.extend({
  template: '{{foo}} {{bar}}',
  data: function() {
    return {
      bar: 'This is bar!'
    }
  }
})

With VueTyped you can extend component using common object-oriented patterns :
@Component()
class Parent {
    foo: string = 'This is foo!'
} 

@Component({ template: '{{foo}} {{bar}}' })
class Child extends Parent {
    bar: string = 'This is bar!'
}

See live demo here or here.
